import React, { Component }  from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component{
  constructor() {
    super();
    this.state = {
      String: 'Hello Amine'
    }


  }

  render() {
    return(
      <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          {this}
        </p>
        <button> Change Text </button>
      </header>
    </div>
    );
  }

}


export default App;
